Sometimes you ask me if I use a 'limited palette,' but why would I do that!?😜

From my perspective, using a "limited palette" in painting is a great way to improve color skills and understand color theory. But, in the long run, it can get a bit boring and limiting. To keep things exciting, artists often need to play with more colors and techniques.

